const fs = require('fs');

fs.readFile('./test.txt', 'utf-8', (err, jsonString) => {
    console.log("Entering the reading function.");
    if (err) {
        console.log(err);
    } else {
        // const data = JSON.parse(jsonString);
        console.log(jsonString);
        // console.log(jsonString);
    }
})
